import './App.css';
import FizzBuzz from './FizzBuzz.js';
const numbers = Array.from(Array(20).keys());
const ListItems = numbers.map((value,index) => { return (
	< li >
	{FizzBuzz(value)}
	</li>)});



function App() {

 return (
    <div className="App">
<ul className="fizzBuzz">
<ListItems />
</ul>
    </div>
  );
}
export default App;
